Use econet;

CREATE TABLE IF NOT EXISTS country(
	CountryId INT NOT NULL AUTO_INCREMENT ,
	CountryName varchar(50) NOT NULL,
	PRIMARY KEY (CountryId));

	call rheem.AddColumnIfNotExists('econet', 'country', 'CountryCode',  'varchar(2) NOT NULL');
	call rheem.AddColumnIfNotExists('econet', 'country', 'IsActive',  'bit NOT NULL');
	call rheem.AddColumnIfNotExists('econet', 'country', 'UpdateDateTime__Gen',  'datetime NOT NULL');
	call rheem.AddColumnIfNotExists('econet', 'country', 'CreateDateTime__Gen',  'datetime NOT NULL');


call rheem.CreateIndexIfNotExists('econet', 'Country_idx1', 'country', 'CountryName', null);
call rheem.CreateIndexIfNotExists('econet', 'Country_idx2', 'country', 'CountryCode', null);

